        <div className='em'>
        {email}
        </div>
        {present_company == 'NAN' ? "Still a student" : ("Working @ " + present_company)}

        <div className='des'>
            {about}
        </div>
    </div>
    )
})

return (
    <>

 {/* <Drawer/> */}
        <div className='blog-cont'>

        {!data?<Loader/>:x}
       {/* {data?"":"nothing here"} */}

        </div>

        </>

)
}

export default AllPeople
